import SignUp from './SignUp';
import { AuthProvider } from "../contexts/AuthContext";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

function App() {
  return (
    <Router>
      <AuthProvider>
        <Switch>
        </Switch>
        <SignUp />
      </AuthProvider>
    </Router>
  )
}

export default App;
